                    <input type='text' id='username' placeholder='Username' onKeyUp={setUsername(value)}/> <br/>
                    <input type='password' id='password' placeholder='Password' onKeyUp={setPassword(value)}/> <br/>
                    <input type='submit' value='Log In' onClick={handleSubmit}/>
                </form>
            </div>
    );
}
